  input: TEXT,F3XA,,"In reply to your letter of March 17, 2004 regarding our November
    03 Report for October 1 - October 31, 2003, hopefully since previous reports were
    amended on the Schedule D - it supplementally updated this one and all necessary
    info is included.  The payments totalling $11,448.82 for direct mail and postage
    were ALL for solicitation and fundraising mail and not for any candidate.  All
    of our employees in  October were paid in non-federal funds because NONE were
    spending 25% or more of their time on Federal Election Activity.   The transfer
    from the non-federal account to the Federal account was NOT for allocated expenses.
    I have amended the expenditures for employee benefits to line 21B.  Since we made
    no non-federal to Federal transfers, we did not reimburse the Federal Account
    for any of the costs associated with employee benefits.  If you have any questions,
    feel free to call."
